import Header from '../components/Header';
import Footer from '../components/Footer';
import CheckoutScreen from '../components/CheckoutScreen';

function Checkout() {
    return (
      <>
      <Header />
      <div className="content">
        <div className="product">
          <CheckoutScreen/>
        </div>
      </div>
      <Footer />
      </>
    )
  }
  
  export default Checkout;
